function AdminSidebar() {
    return (
      <div style={sidebarStyle}>
        <h2 style={headerStyle}>Admin</h2>
        <ul style={listStyle}>
          {["Dashboard", "User Management", "Settings", "Reports"].map((tab, idx) => (
            <li key={idx} style={tabStyle}>
              {tab}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  const sidebarStyle = {
    width: '80px',
    backgroundColor: 'black',
    height: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    paddingTop: '20px',
  };

  const headerStyle = {
    color: 'white',
    fontSize: '14px',
    marginBottom: '30px',
    writingMode: 'vertical-rl',
    transform: 'rotate(180deg)',
  };

  const listStyle = {
    listStyleType: 'none',
    padding: 0,
    margin: 0,
    width: '100%',
  };

  const tabStyle = {
    backgroundColor: 'transparent',
    color: 'white',
    textAlign: 'center',
    padding: '20px 0',
    border: 'none',
    width: '100%',
    cursor: 'pointer',
    borderBottom: '1px solid #444',
    fontSize: '12px',
    transition: 'background-color 0.3s ease',
  };

  export default AdminSidebar;
